<template>
  <div :class="componentName" :style="comCoinAvatarStyle">
    <img :src="imgData" alt="" :class="`${componentName}__img`" />
  </div>
</template>
<script lang="ts">
import { pxCheck } from '../../utils/pxCheck';

const coin2ImgData = {
  ae: 'data:image/png;base64,',
  beam: 'data:image/png;base64,',
  bfc: 'data:image/png;base64,',
  btm: 'data:image/png;base64,',
  cfx: 'data:image/png;base64,',
  ckb: 'data:image/png;base64,',
  dcr: 'data:image/png;base64,',
  ergo: 'data:image/png;base64,',
  etc: 'data:image/png;base64,',
  eth: 'data:image/png;base64,',
  etp: 'data:image/png;base64,',
  grin: 'data:image/png;base64,',
  hns: 'data:image/png;base64,',
  kda: 'data:image/png;base64,',
  lbc: 'data:image/png;base64,',
  moac: 'data:image/png;base64,',
  noicon:
    'data:image/png;base64,',
  pasc: 'data:image/png;base64,',
  pgn: 'data:image/png;base64,',
  rvn: 'data:image/png;base64,',
  sc: 'data:image/png;base64,',
  sero: 'data:image/png;base64,',
  trb: 'data:image/png;base64,',
  vbk: 'data:image/png;base64,',
  vds: 'data:image/png;base64,',
  vns: 'data:image/png;base64,',
  xmr: 'data:image/png;base64,',
  xvg: 'data:image/png;base64,',
  zcl: 'data:image/png;base64,'
};
import { computed, defineComponent, PropType } from 'vue';
import { createComponent } from '@/packages/utils/create';
const { componentName, create } = createComponent('coinavatar');

export default create({
  props: {
    coin: {
      type: String as PropType<string>,
      required: true
    },
    size: {
      type: [String, Number],
      default: 22
    },
    imgSrc: {
      type: String as PropType<string>,
      default: () => undefined
    }
  },
  setup(props) {
    const imgData = computed(() => {
      if (props.imgSrc) {
        return props.imgSrc;
      }
      const coin: string = props.coin as string;
      if (!coin) {
        return '';
      }
      const coinLowerCase = coin.toLowerCase();
      const localSrc = coin2ImgData[coinLowerCase];
      if (localSrc) {
        return localSrc;
      }

      return `https://static.f2pool.com/assets/currencies/logo/${coin.toLowerCase()}-64x64.png`;
    });

    const comCoinAvatarStyle = computed(() => {
      const _size = pxCheck(props.size);
      return {
        width: _size,
        height: _size
      };
    });

    return {
      componentName,
      imgData,
      comCoinAvatarStyle
    };
  }
});
</script>
